import React from "react";
import { Navbar, Nav, NavDropdown, Container } from "react-bootstrap";
import { Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";

const Header = () => {
  return (
    <Navbar expand="lg" bg="dark" data-bs-theme="dark">
      <Container>
        <Navbar.Brand as={Link} to="/">Capture The Flag</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link as={Link} to="/">Home</Nav.Link>
            <NavDropdown title="Question Categories" id="basic-nav-dropdown">
              <NavDropdown.Item as={Link} to="/category/a">Category A</NavDropdown.Item>
              <NavDropdown.Item as={Link} to="/category/b">Category B</NavDropdown.Item>
              <NavDropdown.Item as={Link} to="/category/c">Category C</NavDropdown.Item>
              <NavDropdown.Item as={Link} to="/category/d">Category D</NavDropdown.Item>
              <NavDropdown.Item as={Link} to="/category/e">Category E</NavDropdown.Item>
            </NavDropdown>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default Header;
